contracts/1_ERC20.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.20;

//导入IERC20接口 （简化为内联定义）
interface IERC20 {
    event Transfer(address indexed from , address indexed to , uint256 value);
    event Approval(address indexed owner , address indexed spender , uint256 value);

    function totalSupply() external view returns(uint256);
    function balanceOf(address account) external view returns(uint256);
    function transfer(address to , uint256 value) external returns(bool);
    function allowance(address owner , address spender) external view returns(uint256);
    function approve(address spender, uint256 value) external returns(bool);
    function transferFrom(address sender , address recipient , uint256 amount) external returns(bool);

}


//主ERC20 代币合约
contract SimpleERC20 is IERC20 {

    //代币信息
    string public name;
    string public symbol;
    //string public decimals;

    //存储映射
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    //总供应量
    uint256 private _totalSupply;
    uint8 public decimals;
    //合约所有者
    address public owner;

    //修饰器：仅所有者可调用
    modifier onlyOwner() {
        require(msg.sender == owner , "Only owner can call this function");
        _;
    }

    constructor (string memory name_ , string memory symbol_ , uint256 initialSupply) {
        name = name_;
        symbol = symbol_;
        decimals = 18;
        owner = msg.sender;
        _mint(msg.sender , initialSupply);
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    } 

    function balanceOf(address account ) public view override returns(uint256) {
        return _balances[account];
    }

    function transfer(address to , uint256 value) public override returns(bool) {
        _transfer(msg.sender , to , value);
        return true;
    }

    function allowance(address owner_,address spender) public view override returns(uint256) {
        return _allowances[owner_][spender];
    }

    function approve(address spender , uint256 value) public override returns(bool) {
        _approve(msg.sender , spender , value);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) { 
        _transfer(sender, recipient, amount);

        uint256 currentAllowance = _allowances[sender][msg.sender];
        require(currentAllowance >= amount, "ERC20: transfer amount exceeds allowance");
        unchecked {
            _approve(sender, msg.sender, currentAllowance - amount);
        }
        return true;
    }


    function _transfer(address from , address to , uint256 value) internal {
        require(from != address(0) , "ERC20: transfer from the zero address");
        require(to != address(0) , "ERC20: transfer to the zero address");

        uint256 fromBalance = _balances[from];
        require(fromBalance >= value , "ERC20: insufficient balance");

        unchecked {
            _balances[from] = fromBalance - value;
            _balances[to] += value;
        }

        emit Transfer(from , to , value);

    }

    function _approve(address owner_ , address spender , uint256 value) internal {
        require(owner_ != address(0) , "ERC20: approve from the zero address");
        require(spender != address(0) , "ERC20: approve to the zero address");

        _allowances[owner_][spender] = value;
        emit Approval(owner_,spender,value);
    }


    function _spenderALLowance(address owner_ , address spender , uint256 value) internal {
        uint256 currentAllowance = allowance(owner_ , spender);

        if (currentAllowance != type(uint256).max) {
            require(currentAllowance >= value ,"ERC20: insufficient allowance");
            unchecked {
                _approve(owner_ , spender , currentAllowance - value);
            }
        }
    }

    function mint (address to , uint256 value) public onlyOwner {
        _mint(to , value);
    }

    function _mint(address to , uint256 value) internal {
        require(to != address(0) , "ERC20: mint to the zero address");

        _totalSupply += value;

        unchecked{
            _balances[to] += value;
        }

        emit Transfer(address(0), to , value);
    }

    function burn(uint256 value) public {
        _burn(msg.sender , value);
    }

    function _burn(address from , uint256 value) internal {
        require(from != address(0) , "ERC20: burn from the zero address");

        uint256 fromBalance = _balances[from];
        require(fromBalance >= value , "ERC20: insufficient balance");

        unchecked {
            _balances[from] = fromBalance - value;
            _totalSupply -= value;
        }

        emit Transfer(from , address(0) , value);
    }

    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0) , "New owner is the zero address"); 
        owner = newOwner;
    }

}

